const calcDexSharePrice = (
  val1: bigint,
  val2: bigint,
  total: bigint,
  price1: number,
  price2: number,
  d1: number,
  d2: number
) => {
  const v1 = Number(val1)
  const v2 = Number(val2)
  const t = Number(total)
  return ((10 ** d1 / t) * v1 * price1) / 10 ** d1 + ((10 ** d1 / t) * v2 * price2) / 10 ** d2
}

